import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Log />} />
          <Route path="/signup" element={<SingUp />} />
          <Route path="/reservations" element={<Reserving />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
